import { __decorate } from "tslib";
import { Injectable } from '@angular/core';
import { HttpClient } from '@angular/common/http';
let BackendService = class BackendService {
    constructor(httpClient) {
        this.httpClient = httpClient;
        this.adminStatus = false;
        this.status = false;
        this.url = 'https://localhost:7083/api/v1/moviebooking';
    }
    authenticate(loginId, password) {
        return this.httpClient.get(this.url + '/login?LoginId=' + loginId + '&Password=' + password);
    }
    addUser(user) {
        return this.httpClient.post(this.url + '/register', user);
    }
    changePassword(loginId, forgotPassword) {
        return this.httpClient.put(this.url + "/" + loginId + '/forgetpassword', forgotPassword, { responseType: 'text' });
    }
};
BackendService.ctorParameters = () => [
    { type: HttpClient }
];
